import './expolreimage.css'
import { Swiper, SwiperSlide } from "swiper/react";
/* import { swipperimage } from "../../../";
 */import Disciverdata from './discoverimage.json';
import autherimage from '../../../images/author.jpg';
// Import Swiper styles
import "../../Allindexs/Explore/Swipper/Swipper.css";
import "../swiper/css/pagination";
import "swiper/css/navigation";

import "./Swipper.css";

 // import required modules
  import { Pagination, Navigation } from "swiper";

  const ExploreImages=()=> {
    return (
      <>
        <Swiper
        breakpoints={
          {
            0:{
              slidesPerView:1,
              spaceBetween:10
            },
            480:{
              slidesPerView:1,
              spaceBetween:10
            },
            768:{
              slidesPerView:1,
              spaceBetween:15
            },
            1024:{
              slidesPerView:3,
              spaceBetween:15
            },
            1280:{
              slidesPerView:3,
              spaceBetween:25
            }
          }
        }
          slidesPerView={3}
          spaceBetween={30}
          slidesPerGroup={3}
          loop={true}
          loopFillGroupWithBlank={true}
          pagination={{
            clickable: true,
          }}
          navigation={true}
          modules={[Pagination, Navigation]}
          className="mySwiper"
        >
          <div className="swipper-container">
          {
            Disciverdata.map((discover)=>{
              return(
                <SwiperSlide className='swipper-item'>
                  <img src={discover.image} alt="" />
                <div className="explore-info">
                  <h1 className="title">{discover.title}</h1>
                  <div className="discover-info">
                    <div className="image">
                      <img src={autherimage} alt="" />
                    </div>
                    <div className="info">
                      <h4>{discover.name}</h4>
                      <p>@libertryart</p>
                    </div>
                  </div>
                </div>
              </SwiperSlide>
              )
            })
          }
          </div>
        </Swiper>
      </>
    );
  }
  export default ExploreImages;
